import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-select-root" dir="${ifDefined(context.effectiveDir)}" id="${ifDefined(context._id)}-select" @click="${context._onclick}">${ context.selectedOptionIcon ? block1(context) : undefined }<div class="ui5-select-label-root" data-sap-focus-ref tabindex="${ifDefined(context.tabIndex)}" role="combobox" aria-haspopup="listbox" aria-label="${ifDefined(context.ariaLabelText)}" aria-describedby="${ifDefined(context.valueStateTextId)}" aria-disabled="${ifDefined(context.isDisabled)}" aria-required="${ifDefined(context.required)}" aria-expanded="${ifDefined(context._isPickerOpen)}" @keydown="${context._onkeydown}" @keyup="${context._onkeyup}" @focusin="${context._onfocusin}" @focusout="${context._onfocusout}">${ifDefined(context._text)}</div><span id="${ifDefined(context._id)}-selectionText" class="ui5-hidden-text" aria-live="polite" role="status"></span><${scopeTag("ui5-icon", tags, suffix)} name="slim-arrow-down" input-icon ?pressed="${context._iconPressed}" dir="${ifDefined(context.effectiveDir)}"></${scopeTag("ui5-icon", tags, suffix)}>${ context.hasValueState ? block2(context) : undefined }<slot name="formSupport"></slot></div>`; };
const block1 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} aria-hidden="true" class="ui5-select-option-icon" name="${ifDefined(context.selectedOptionIcon)}" dir="${ifDefined(context.effectiveDir)}"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block2 = (context) => { return html`<span id="${ifDefined(context._id)}-valueStateDesc" class="ui5-hidden-text">${ifDefined(context.valueStateText)}</span>`; };


	return block0(context);
};

export default main;
